INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("ヤマト", 100, 1, 0.0, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", "2024/10/31 12:00:00", 2, -416.5, 3001100, 2.1, 130011, "2030/01/01 14:59:59", 3001);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("ヤマト", 101, 4, 0.0, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", "2024/10/31 12:00:00", 2, -416.5, 3001101, 5.68, 130011, "2030/01/01 14:59:59", 3001);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("ヤマト", 102, 1, 0.0, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", "2024/10/31 12:00:00", 1, -416.5, 3001102, 0.0, 130011, "2030/01/01 14:59:59", 3001);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("フブキ", 100, 1, 0.0, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", "2024/10/31 12:00:00", 1, -416.5, 3002100, 0.0, 130211, "2030/01/01 14:59:59", 3002);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("フブキ", 101, 1, 0.0, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", "2024/10/31 12:00:00", 1, -416.5, 3002101, 0.0, 130211, "2030/01/01 14:59:59", 3002);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("フブキ", 102, 5, 0.0, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", "2024/10/31 12:00:00", 2, -416.5, 3002102, 8.53, 130211, "2030/01/01 14:59:59", 3002);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("フブキ", 103, 7, 0.0, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", "2024/10/31 12:00:00", 1, -416.5, 3002103, 5.67, 130211, "2030/01/01 14:59:59", 3002);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("フブキ", 104, 1, 0.0, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", "2024/10/31 12:00:00", 1, -416.5, 3002104, 0.0, 130211, "2030/01/01 14:59:59", 3002);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("フブキ", 300, 3, 0.0, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", "2024/10/31 12:00:00", 3, -416.5, 3002300, 0.0, 130211, "2030/01/01 14:59:59", 3004);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("フブキ", 301, 7, 0.0, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", "2024/10/31 12:00:00", 7, -416.5, 3002400, 0.0, 130211, "2030/01/01 14:59:59", 3005);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("フブキ", 200, 2, 0.0, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", "2024/10/31 12:00:00", 1, -416.5, 3003200, 4.4, 130211, "2030/01/01 14:59:59", 3003);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("フブキ", 201, 7, 0.0, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", "2024/10/31 12:00:00", 7, -416.5, 3003201, 0.0, 130211, "2030/01/01 14:59:59", 3003);
INSERT INTO `v1_2e3e35fcf020412898324309152943d1419e21d1d54914263c82dc53c2f0b244` VALUES ("フブキ", 202, 1, 0.0, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", "2024/10/31 12:00:00", 2, -416.5, 3003202, 5.6, 130211, "2030/01/01 14:59:59", 3003);
